import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';


const DriverAgent = () => {

  const [values, setValues] = useState({});

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setValues({ ...values, [name]: value });
  }

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");
  const [status, setStatus] = useState("");
  //const navigate = useNavigate();
  // useEffect(() => {
  //   const auth = localStorage.getItem('user');
  //   if (auth) {
  //     navigate('/')
  //   }
  // }, [])


  const collectData = async () => {
    //return console.log(JSON.stringify({username,password,role,status}));

    console.warn(email, password, role, status);
    let result = await fetch("http://localhost:5000/register", {
      method: "post",
      body: JSON.stringify({ email, password, role, status }),
      headers: {
        'content-type': 'application/json'
      }
    });

    result = await result.json();
    console.warn(result);
    console.log(result);
    localStorage.setItem("user", JSON.stringify(result))
    // navigate('/Login')


  }


  return (
    <div class="body">
      <div id="homebtn">
        <a href="main.php"><i class="fa-solid fa-house"></i></a>
      </div>
      <div class="form-container sign-up-form">

        <div class="form-box sign-up-box">
          <h2>Sign Up</h2>
          <div class="sliding-link">
            <p>Already a member?</p>
            <span class="sign-in-btn"><a href=""> Sign in</a></span>
          </div>
          <form method="post" enctype="multipart/form-data" class="box2">
            <div class="box1">
              <div>
                <div class="field">
                  <i class="fa-solid fa-at"></i>
                  <input type="text" name="company_name" placeholder="Company Name" onChange={onChangeHandler} value={values.company_name} />
                </div>
                <div class="field">
                  <i class="fa-regular fa-user"></i>
                  <input type="text" name="brand_name" placeholder="Brand Name" onChange={onChangeHandler} value={values.brand_name} />
                </div>
                <div class="field">
                  <i class="fa-regular fa-user"></i>
                  <input type="text" name="owner_name" placeholder="Owner name" onChange={onChangeHandler} value={values.owner_name} />
                </div>
                <div class="field">
                  <i class="fa-regular fa-user"></i>
                  <input type="text" name="mobile_number" placeholder="Mobile Number" onChange={onChangeHandler} value={values.mobile_number} />
                </div>
                <div class="field">
                  <i class="fa-solid fa-calendar-days"></i>
                  <input type="text" name="dob" placeholder="Date of Birth" onChange={onChangeHandler} value={values.dob} onfocus="this.type='date'" onblur="this.type='text'" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-at"></i>
                  <input type="email" name="email" placeholder="Email ID" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-phone"></i>
                  <input type="text" onkeypress="return event.charCode >= 48 && event.charCode <= 57"
                    maxlength="10" name="cont" placeholder="Contact Number" />
                </div>
              </div>
              <div>
                <div class="field">
                  <i class="fa-solid fa-address-book"></i>
                  <input type="text" name="add" placeholder="Address" />
                </div>
                <div class="field">
                  <i class="fa-sharp fa-solid fa-location-dot"></i>
                  <input type="text" name="city" placeholder="City" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-location-arrow"></i>
                  <input type="text" name="State" placeholder="State" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-map-location-dot"></i>
                  <input type="text" name="country" placeholder="Country" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-map-pin"></i>
                  <input type="text" name="pcode" placeholder="Postal Code" />
                </div>
                <div class="field">
                  <i class="fa-solid fa-id-card"></i>
                  <input type="text" name="lnumber" placeholder="License Number" />
                </div>
                <div class="field">
                  <i class="fa-regular fa-calendar"></i>
                  <input type="text" name="expiry" placeholder="License Expiry" onfocus="this.type='date'" onblur="this.type='text'" />
                </div>
              </div>

            </div>
            <input class="submit-btn" type="submit" value="Sign Up" />
          </form>

        </div>
      </div>
    </div>
  );

}

export default DriverAgent;
